#define _CRT_SECURE_NO_WARNINGS
#include <stdio.h>

int main(void)
{
	int large, small, items, numLarge, numSmall;

	printf("Large capacity:\n");
	scanf("%d", &large);
	printf("Small capacity:\n");
	scanf("%d", &small);
	printf("Number of items:\n");
	scanf("%d", &items);

	numLarge = items / large;
	items = items % large;
	numSmall = items / small;
	items = items % small;
	printf("Allocated:\n - Large: %d\n - Small: %d\n - Scrap: %d", numLarge, numSmall, items);

    return 0;
}
